Hemos decidido desde Salvación Nacional seguimos haciendo el llamado a la unión, sin titubeos. Estamos sin duda ante el peligro inminente de perder la democracia, como nunca antes, ante una izquierda violenta que usa todo para destruir al país. Se hace urgente el respaldo a 
@ABDELAESPRIELLA
 para salvar a Colombia.

